/**
 * Declaração Única de Importação - Intervenientes Privados
 *
 * <p><h3>Duimp - Declara&ccedil;&atilde;o &Uacute;nica de Importa&ccedil;&atilde;o</h3>  <h4>Introdu&ccedil;&atilde;o</h4>  <p>Bem-vindo(a) &agrave; API do sistema Pucomex - Declara&ccedil;&atilde;o &Uacute;nica de Importa&ccedil;&atilde;o.</p>  <p>A Declara&ccedil;&atilde;o &Uacute;nica de Importa&ccedil;&atilde;o (Duimp) , reunir&aacute; todas as informa&ccedil;&otilde;es de natureza aduaneira, administrativa, comercial, financeira, tribut&aacute;ria e fiscal pertinentes ao controle das importa&ccedil;&otilde;es pelos &oacute;rg&atilde;os competentes da Administra&ccedil;&atilde;o P&uacute;blica brasileira na execu&ccedil;&atilde;o de suas atribui&ccedil;&otilde;es legais.</p>  <p>O processo eliminar&aacute; diversas redund&acirc;ncias presentes no fluxo atual e permitir&aacute; a visualiza&ccedil;&atilde;o da integralidade da opera&ccedil;&atilde;o tanto pelo operador privado como pelos &oacute;rg&atilde;os governamentais.</p>  <p>Outro importante avan&ccedil;o &eacute; a flexibiliza&ccedil;&atilde;o, em rela&ccedil;&atilde;o ao modelo atual, do momento de presta&ccedil;&atilde;o das informa&ccedil;&otilde;es pelo importador. Respeitando determinados marcos temporais, o importador ter&aacute; maior dom&iacute;nio sobre o fluxo de informa&ccedil;&otilde;es e dos procedimentos relacionados &agrave; sua opera&ccedil;&atilde;o, podendo optar pelo momento mais oportuno para prest&aacute;-las &agrave; Administra&ccedil;&atilde;o e determinando, assim, a movimenta&ccedil;&atilde;o de seu processo.</p>  <h4>URLs de Acesso</h4>  <p>Para utilizar os servi&ccedil;os dispon&iacute;veis nessa API deve-se seguir o seguinte padr&atilde;o de URL:</p>  <p><em>https://{ambiente}/duimp-api/api/{servi&ccedil;o}</em></p>  <p>Onde, em <strong>{ambiente}</strong> deve-se informar o ambiente desejado dentre os ambientes dispon&iacute;veis na tabela abaixo e em <strong>{servi&ccedil;o}</strong> utilizar a URI do servi&ccedil;o desejado.</p>  <style type=\"text/css\"> .tg  {border-collapse:collapse;border-color:#bbb;border-spacing:0;width: 604px;} .tg td{background-color:#E0FFEB;border-color:#bbb;border-style:solid;border-width:1px;color:#594F4F;   font-family:Arial, sans-serif;font-size:14px;overflow:hidden;padding:10px 5px;word-break:normal;} .tg th{background-color:#9DE0AD;border-color:#bbb;border-style:solid;border-width:1px;color:#493F3F;   font-family:Arial, sans-serif;font-size:14px;font-weight:normal;overflow:hidden;padding:10px 5px;word-break:normal;} .tg .tg-cabecalho{text-align:left;vertical-align:top;} .tg .tg-corpo{border-color:inherit;text-align:left;vertical-align:top;} </style>  <table class=\"tg\" style=\"width: 604px;\"> <thead>   <tr>     <th class=\"tg-cabecalho\"><span style=\"font-weight:bold\">Nome do Ambiente</span></th>     <th class=\"tg-cabecalho\"><span style=\"font-weight:bold\">URL de acesso</span></th>   </tr> </thead> <tbody>   <tr>     <td class=\"tg-corpo\">Ambiente de Validação das Empresas</td>     <td class=\"tg-corpo\">val.portalunico.siscomex.gov.br</td>   </tr>   <tr>     <td class=\"tg-corpo\">Ambiente de Produção</td>     <td class=\"tg-corpo\">portalunico.siscomex.gov.br</td>   </tr> </tbody> </table>  <p>&nbsp;</p>  <p><strong>Exemplo:</strong> Para o servi&ccedil;o &quot;Consulta dos dados gerais da vers&atilde;o vigente de uma Duimp&quot; a URI &eacute; &quot;ext/duimp/{numero}/{versao}&quot;.</p>  <p>Logo, abaixo temos um exemplo de URL completa considerando o ambiente de Valida&ccedil;&atilde;o, consumindo este servi&ccedil;o</p>  <p><em>https://val.portalunico.siscomex.gov.br/duimp-api/api/ext/duimp/20BR00001001899/1</em></p>  <h4>As opera&ccedil;&otilde;es que podem ser gerenciadas pela API do sistema s&atilde;o:</h4>  <h4>Opera&ccedil;&otilde;es para Registro:</h4> <ul>  <li>Salvar dados gerais da Duimp para registro</li>  <li>Salvar dados gerais da Duimp retifica&ccedil;&atilde;o</li>  <li>Atualizar dados gerais da Duimp para registro ou retifica&ccedil;&atilde;o </li>  <li>Salvar dados dos itens da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Atualizar dados dos itens da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Excluir dados gerais e itens da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Excluir dados dos itens da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Consultar valores calculados da Duimp</li>  <li>Consultar valores calculados dos itens da Duimp</li>  <li>Solicitar o diagn&oacute;stico da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Solicitar o registro da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Recuperar modelo dos dados gerais da Duimp para utilizar em novo registro ou retifica&ccedil;&atilde;o</li>  <li>Recuperar modelo dos dados dos itens da Duimp para utilizar em novo registro ou retifica&ccedil;&atilde;o</li>  <li>Recuperar modelo da solicita&ccedil;&atilde;o de registro da Duimp para utilizar em novo registro ou retifica&ccedil;&atilde;o</li> </ul>  <h4>Opera&ccedil;&otilde;es de Consulta:</h4>  <ul>  <li>Consultar os dados gerais da Duimp j&aacute; registrada</li>  <li>Consultar os dados de um item espec&iacute;fico da Duimp j&aacute; registrada</li>  <li>Consultar os dados de uma faixa de itens da Duimp j&aacute; registrada</li>  <li>Consultar a versão vigente de uma Duimp j&aacute; registrada</li> </ul>  <p><b>Obs:</b> Todas as operações contam com uma descrição geral da operação abaixo da url, além da descrição resumida exibida ao seu lado.</p>  <h4>Integrações</h4>  <p>A Duimp &eacute; um sistema integrador que interage com com diversos outros sistemas da fam&iacute;lia Pucomex, al&eacute;m de alguns sistemas da fam&iacute;lia Siscomex, relacionados abaixo:</p>  <ul>     <li>         <h4>Sistema Siscomex Carga</h4>         <ul>             <li><strong>Produ&ccedil;&atilde;o:</strong> <a href=\"https://www4.receita.fazenda.gov.br/g33159/jsp/logon.jsp?ind=11\">https://www4.receita.fazenda.gov.br/g33159/jsp/logon.jsp?ind=11</a></li>         </ul>     </li>     <li>         <h4>Sistemas do Portal &Uacute;nico de Com&eacute;rcio Exterior</h4>         <ul>    <li>Sistema Anexa&ccedil;&atilde;o Eletr&ocirc;nica (<a href=\"https://docs.portalunico.siscomex.gov.br/swagger/edocex.html\">https://docs.portalunico.siscomex.gov.br/swagger/edocex.html</a>)</li>    <li>Sistema Cat&aacute;logo de Produtos (<a href=\"https://docs.portalunico.siscomex.gov.br/swagger/catp.html\">https://docs.portalunico.siscomex.gov.br/swagger/catp.html</a>)</li>    <li>Sistema Cadastro de Atributos (<a href=\"https://val.portalunico.siscomex.gov.br/cadatributos/api/atributo-ncm/download/json\">https://val.portalunico.siscomex.gov.br/cadatributos/api/atributo-ncm/download/json</a> ou <a href=\"https://portalunico.siscomex.gov.br/cadatributos/api/atributo-ncm/download/json\">https://portalunico.siscomex.gov.br/cadatributos/api/atributo-ncm/download/json</a>)</li>    <li>Sistema Tratamento Administrativo e LPCO (<a href=\"https://docs.portalunico.siscomex.gov.br/swagger/talpco.html\">https://docs.portalunico.siscomex.gov.br/swagger/talpco.html</a>)</li>    <li>Sistema Tabelas Aduaneiras (<a href=\"https://docs.portalunico.siscomex.gov.br/pages/tabelas_dominio/\">https://docs.portalunico.siscomex.gov.br/pages/tabelas_dominio/</a>)</li>    <li>Sistema Tratamento Tribut&aacute;rio (<a href=\"https://docs.portalunico.siscomex.gov.br/swagger/ttce.html\">https://docs.portalunico.siscomex.gov.br/swagger/ttce.html</a>)</li>         </ul>     </li> </ul>  <h3>Fluxos de utiliza&ccedil;&atilde;o da API</h3> <h4>Fluxo M&iacute;nimo</h4> <img src=\"data:image/png;base64,\" alt=\"Fluxo 1\">  <h4>Fluxo Simplificado</h4> <img src=\"data:image/png;base64,\" alt=\"Fluxo 2\">  <h4>Fluxo da Consulta</h4> <img src=\"data:image/png;base64,\" alt=\"Fluxo 3\">  <h4>Fluxos Alternativos</h4> <img src=\"data:image/png;base64,\" alt=\"Fluxo 4\">       
 *
 */
@Path("/")
@Api(value = "/", description = "")
public interface RecuperaoDeModelosApi  {

    /**
     * Recuperar modelo dos dados gerais da Duimp.
     *
     * Use esta funcionalidade para gerar o JSON que servirá de modelo para a funcionalidade salvar dados gerais.
     *
     */
    @GET
    @Path("/ext/modelo/duimp/{numero-duimp}/{versao-duimp}")
    @Produces({ "application/json" })
    @ApiOperation(value = "Recuperar modelo dos dados gerais da Duimp.", notes = "Use esta funcionalidade para gerar o JSON que servirá de modelo para a funcionalidade salvar dados gerais.", tags={ "Recuperação de modelos" })
    @ApiResponses(value = { 
        @ApiResponse(code = 200, message = "Operação realizada com sucesso", response = DuimpCover.class),
        @ApiResponse(code = 401, message = "Usuário não autenticado ou autenticação inválida"),
        @ApiResponse(code = 403, message = "Usuário não tem permissão de acesso ao recurso"),
        @ApiResponse(code = 404, message = "Recurso não encontrado"),
        @ApiResponse(code = 422, message = "Erro(s) de validação da camada de negócio", response = RespostaApiErro.class),
        @ApiResponse(code = 500, message = "Erro interno no servidor") })
    public Response buscarDadosCapaDuimp(@ApiParam(value = "Número da Duimp.",required=true) @PathParam("numero-duimp") String numeroDuimp, @ApiParam(value = "Versão da Duimp.",required=true) @PathParam("versao-duimp") Object versaoDuimp, @ApiParam(value = "JSON Web Token (JWT) contendo as informações do usuário. Este token é recuperado no parâmetro Set-Token no response da autenticação" ,required=true)@HeaderParam("Authorization") String authorization, @ApiParam(value = "Token de prevenção contra ataques CSRF. Este token é recuperado no parâmetro X-CSRF-Token no response da autenticação" ,required=true)@HeaderParam("X-CSRF-Token") String xCSRFToken);

    /**
     * Recuperar modelo dos dados dos itens da Duimp.
     *
     * Use esta funcionalidade para gerar o JSON que servirá de modelo para a funcionalidade salvar os dados dos itens da Duimp.
     *
     */
    @GET
    @Path("/ext/modelo/duimp/{numero-duimp}/{versao-duimp}/itens")
    @Produces({ "application/json" })
    @ApiOperation(value = "Recuperar modelo dos dados dos itens da Duimp.", notes = "Use esta funcionalidade para gerar o JSON que servirá de modelo para a funcionalidade salvar os dados dos itens da Duimp.", tags={ "Recuperação de modelos" })
    @ApiResponses(value = { 
        @ApiResponse(code = 200, message = "Operação realizada com sucesso", response = ItemCover.class, responseContainer = "List"),
        @ApiResponse(code = 401, message = "Usuário não autenticado ou autenticação inválida"),
        @ApiResponse(code = 403, message = "Usuário não tem permissão de acesso ao recurso"),
        @ApiResponse(code = 404, message = "Recurso não encontrado"),
        @ApiResponse(code = 422, message = "Erro(s) de validação da camada de negócio", response = RespostaApiErro.class),
        @ApiResponse(code = 500, message = "Erro interno no servidor") })
    public Response buscarDadosItensDuimp(@ApiParam(value = "Número da Duimp.",required=true) @PathParam("numero-duimp") String numeroDuimp, @ApiParam(value = "Versão da Duimp.",required=true) @PathParam("versao-duimp") Object versaoDuimp,  @NotNull @ApiParam(value = "Se refere ao primeiro item a ser retornado.",required=true)  @QueryParam("inicial") Object inicial,  @NotNull @ApiParam(value = "Se refere a quantidade de itens retornados.",required=true)  @QueryParam("tamanho") Object tamanho, @ApiParam(value = "JSON Web Token (JWT) contendo as informações do usuário. Este token é recuperado no parâmetro Set-Token no response da autenticação" ,required=true)@HeaderParam("Authorization") String authorization, @ApiParam(value = "Token de prevenção contra ataques CSRF. Este token é recuperado no parâmetro X-CSRF-Token no response da autenticação" ,required=true)@HeaderParam("X-CSRF-Token") String xCSRFToken);

    /**
     * Recuperar modelo da solicitação de registro da Duimp.
     *
     * Use esta funcionalidade para gerar o JSON que servirá de modelo para a funcionalidade de registro da Duimp.
     *
     */
    @GET
    @Path("/ext/modelo/duimp/{numero-duimp}/{versao-duimp}/registros")
    @Produces({ "application/json" })
    @ApiOperation(value = "Recuperar modelo da solicitação de registro da Duimp.", notes = "Use esta funcionalidade para gerar o JSON que servirá de modelo para a funcionalidade de registro da Duimp.", tags={ "Recuperação de modelos" })
    @ApiResponses(value = { 
        @ApiResponse(code = 200, message = "Operação realizada com sucesso", response = RegistroCover.class),
        @ApiResponse(code = 401, message = "Usuário não autenticado ou autenticação inválida"),
        @ApiResponse(code = 403, message = "Usuário não tem permissão de acesso ao recurso"),
        @ApiResponse(code = 404, message = "Recurso não encontrado"),
        @ApiResponse(code = 422, message = "Erro(s) de validação da camada de negócio", response = RespostaApiErro.class),
        @ApiResponse(code = 500, message = "Erro interno no servidor") })
    public Response buscarModeloRegistroDuimp(@ApiParam(value = "Número da Duimp.",required=true) @PathParam("numero-duimp") String numeroDuimp, @ApiParam(value = "Versão da Duimp.",required=true) @PathParam("versao-duimp") Object versaoDuimp, @ApiParam(value = "JSON Web Token (JWT) contendo as informações do usuário. Este token é recuperado no parâmetro Set-Token no response da autenticação" ,required=true)@HeaderParam("Authorization") String authorization, @ApiParam(value = "Token de prevenção contra ataques CSRF. Este token é recuperado no parâmetro X-CSRF-Token no response da autenticação" ,required=true)@HeaderParam("X-CSRF-Token") String xCSRFToken);
}

